import React, { Component } from "react";
import "../Components/Background/style.css";



class Arrived extends Component {

    render() {
        return (
            <div>
                <div className="background">
                    <h1>You've Arrived!</h1>
                </div>
            </div>
        )
    }

}

export default Arrived;
